export function isEmpty(obj){
    return (
        obj.constructor === Object &&
        Object.entries(obj).length === 0
    )
}

export function sortObj(obj){
    sorted = {};
    Object.keys(obj).sort().forEach(key => {
        sorted[key] = obj[key];
    })
    return sorted;
}
